import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {regular} from '@fortawesome/fontawesome-'
import image from './kenah.jpeg';sv
import './Header.css';

function Header() {
  return (
      <header className="header">
        <img src={image} className="image" alt="image" />
        <h2>Ken Muia</h2>
        <a href='mailto:muiaken88@gmail.com' target="_blank"><i class="fa fa-envelope" aria-hidden="true"></i>Email</a>
        <a href='https://www.linkedin.com/in/kennedymuia/' target="_blank">LinkedIn</a>
      </header>
  );
}

export default Header;
